import { BUSINESS_ACTION } from "../actionTypes";
export default function submitBusinessAction(
  businessName,
  numEmployees,
  zip,
  industry
) {
  return {
    type: BUSINESS_ACTION,
    payload: {
      businessName: businessName,
      numEmployees: numEmployees,
      industry: industry,
      zip: zip,
    },
  };
}
